import React, { Component } from 'react'
import Snake from './Snake.gif'
export class Spinner extends Component {
    render() {
        return (
            <div className="text-center my-2">
                <img src={Snake} alt="Loading" /> 
            </div>
        )
    }
}

export default Spinner
